Ninja's Creed/Royal Kill (2009) 

Verenigde Staten
Actie / Thriller
90 minuten

geregisseerd door Babar Ahmed
met Lalaine, Eric Roberts en Nicole Brown

Princess (Lalaine) komt in aanraking met een buitenlandse jongen. Ze wordt verliefd op hem en dit blijkt bepaald geen toeval te zijn, want Princess blijkt de laatste familieverwante te zijn van de koninklijke familie uit Samarza. De jongen is gestuurd om haar te beschermen, want een groep moordenaars is er op uit om Princess te vermoorden.


